import React, { useState, useEffect } from 'react';

function KakaoMap() {
  useEffect(() => {
    const script = document.createElement('script');
    script.async = true;
    script.src = '';
    document.head.appendChild(script);
  });
  return (
    <div className='App'>
      <script></script>
    </div>
  );
}

export default App;
